import React from "react";
import { NavLink } from "react-router-dom";
import "./SearchBarItems.scss";

const SearchBarItems = (props) => {
  return (
    <div className="search-item">
      <ul>
        <NavLink
          to={props.url}
          // onClick={changeShipmentInfo}
        ><a>
          {props.name}</a>
        </NavLink>
      </ul>
    </div>
  );
};

export default SearchBarItems;
